import React,{Component} from "react";
import Card from "react-bootstrap/Card";
// import Button from "react-bootstrap/Button";
// import ListGroup from "react-bootstrap/ListGroup";
import AddPokemonButton from "../AddPokemonButton/AddPokemonButton";
import DeletePokemonButton from "../DeletePokemonButton/DeletePokemonButton";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "./style.css";

class PokemonProfile extends Component {

    render() {
        return(
            <div>
                <Container>
                    <Row className="justify-content-md-center">
                        <Col xs lg="2">
                        </Col>
                        <Col md="8">
                            <Card className="justify-content-md-center">
                                <Card.Header as="h5">TRAINER PROPS NAME</Card.Header>
                                <Card.Body>
                                    <Card.Text>
                                        <span className="list">
                                            <li>Pokemon: </li>
                                            <li>Type:</li>
                                            <li>Move:</li>
                                        </span>
                                    </Card.Text>
                                    <AddPokemonButton></AddPokemonButton>
                                    <DeletePokemonButton></DeletePokemonButton>
                                </Card.Body>
                            </Card>
                        </Col>
                        <Col xs lg="2">
                        </Col>
                    </Row>
                </Container>


            </div>
        )
    }
}

export default PokemonProfile;
